p.x:
var $bm_rt;
var minT, maxT, tarLayer, stTime, oP, iP, dif, dif, ap;
try {
    minT = 0.12;
    maxT = 0.72;
    tarLayer = comp('SLIDE 04 - FRAME 02 - 05').layer(thisComp._name);
    stTime = tarLayer.startTime;
    oP = tarLayer.outPoint;
    iP = tarLayer.inPoint;
    if (stTime < iP)
        dif = $bm_div($bm_sub(oP, stTime), maxT);
    else
        dif = $bm_div($bm_sub(oP, iP), maxT);
    ap = tarLayer.transform.position.valueAtTime($bm_sum(stTime, $bm_mul(time, dif)));
    $bm_rt = [
        ap[0] / (thisComp.width / 100),
        ap[1] / (thisComp.height / 100)
    ];
} catch (e) {
    $bm_rt = value;
}

var $bm_rt;
var x, y;
x = $bm_div(thisComp.width, 2);
y = $bm_div(thisComp.height, 2);
$bm_rt = [
    x,
    y
];

