tm.x:
var $bm_rt;
var fKey, firstDifM, secondDifM, firstDifK, secondDifK, firstDif, secondDif;
try {
    fKey = key(1).time;
    firstDifM = $bm_sub(marker.key(1).time, inPoint);
    secondDifM = $bm_sub(outPoint, marker.key(1).time);
    firstDifK = $bm_sub(key(2).time, key(1).time);
    secondDifK = $bm_sub(key(numKeys).time, key(2).time);
    firstDif = $bm_div(firstDifM, firstDifK);
    $bm_rt = secondDif = $bm_div(secondDifM, secondDifK);
    if (time < marker.key(1).time) {
        $bm_rt = valueAtTime($bm_sum(key(1).time, $bm_div($bm_sub(time, inPoint), firstDif)));
    } else {
        $bm_rt = valueAtTime($bm_sum(key(2).time, $bm_div($bm_sub(time, key(2).time), secondDif)));
    }
} catch (e) {
    $bm_rt = value;
}
